import React from "react";
import classes from "../styles/HeaderBurger.module.css";
import NavigationBurger from "../components/NavigationBurger";
import imgg from "../img/yuovelir.png";
import Footer from "../components/Footer";

function Jewelry() {
  return (
    <div className={classes.Jewelry}>
      <NavigationBurger></NavigationBurger>
      <p style={{ borderTop: "2px solid #fff", margin: "30px 162px" }}></p>
      <div className={classes.colect}>
        <div className={classes.productItem}>
          <img src={imgg} alt="" />
          <div className={classes.itemInfo}>
            <div>
              <span className={classes.name}>Цепочка</span>
              <span className={classes.brend}> Бренд</span>
            </div>
            <div className={classes.title}>описание</div>
            <div className={classes.price}>цена</div>
          </div>
        </div>
      </div>
      <Footer></Footer>
    </div>
  );
}

export default Jewelry;
